extractFeatures = function (word) {
    features = []
    features.push(word.length.toString() + 'wl')
    if (word.length > 1)
        for (var i = 0; i < word.length - 1; i++) {
            features.push(word.slice(i, i + 2))
        }
    if (word.length > 2)
        for (var i = 0; i < word.length - 2; i++) {
            features.push(word.slice(i, i + 3))
        }
    if (word.length > 3)
        for (var i = 0; i < word.length - 3; i++) {
            features.push(word.slice(i, i + 4))
        }
    if (word.length > 4)
        for (var i = 0; i < word.length - 4; i++) {
            features.push(word.slice(i, i + 5))
        }
    features.push(vc(word).toString() + 'vc')
    features.push(cc(word).toString() + 'cc')
    features.push(ac(word).toString() + 'ac')
    features.push(ds(word).toString() + 'ds')
    return features
}
